import './ExpenseDate.css';

function ExpenseDate(props){
    day= props.date.getDate();
    month = props.date.toLocalString('en-US',{month:'long'});
    year= props.date.getFullYear();

    return(
        <div>
            <div>{month}</div>
            <div>{year}</div>
            <div>{day}</div>
        </div>
    )
}
